import React from 'react';
import Navbar from '../navbar';
import './team.css';
import Footer from '../footer/footer';
import Container from '../../Container';
import Newsletter from '../newsletter/newsletter';

 function Team() {
  return (
     <div className="team">
             <header className="teampageheader">
                <Navbar/>
                <div className="teampagebox">
                        <h1>Our Team</h1>
                </div>
              </header>
                <main>
                   <Container>
                      <div className="teams">
                             <h3 style={{  textAlign: "center" , margin: "1", }}>Team</h3>
                             <h1 style={{ textAlign: "center", fontSize: "3.5rem" , color: "#274C5B" }}>Our Organic Experts</h1>
                              <p style={{    fontSize: "1.8rem", width: "90%" , textAlign:"center" }}>Simply dummy text of the printing and typesetting industry. Lorem had ceased to been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley.</p>
                      </div>
                      <Newsletter/>
                   </Container>
                </main>
              <Footer/>
     </div>
  );
}
export default Team;
